import React, { useState } from 'react'

function App() {


  const r = useState(5);


  let likes = r[0];
  let setLikes = r[1]

  function increment() {
    setLikes(likes+1)
  }

  function decrement() {
    setLikes(likes-1)
  }


  return (
    <div className="App">
      <h1>{likes}</h1>
      <input>
        type="text"

      </input>
      <button onClick={increment}>Increment</button>
      <button onClick={decrement}>Decrement</button>
    </div>
  );
}

export default App;
